elements.description:
Date on which the patient began therapy for tuberculosis (or suspected tuberculosis).   This date may be derived from: 
the date the patient first ingested medication (if documented in a medical record or directly observed therapy record); 
the date medication was first dispensed to the patient (as documented in a medical or pharmacy record);  
the date medication was first prescribed to patient by a health care provider (documented in a medical record or prescription given to the patient).
